import React from 'react';
import Home from './Home'
import Register from './Register'
import {  Route, BrowserRouter as Router, Switch } from 'react-router-dom';
import About from './About';
function App() {
  return(
    <div className="body">

      <Router>
        <Switch>
          <Route exact path="/">
          <Home/>
          </Route>
          <Route path="/register">
            <Register/>
          </Route>
          <Route path="/about">
            <About/>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}
export default App;
